import React from 'react';
import './App.css';
import {Switch , Route , Link} from 'react-router-dom';
import {Homepage} from './pages/homepage/homepage.com';

const Hatspage = (props)=>(
  <div>
    <h1>Hats Page</h1>
    {console.log(props.match.params.hatid)}
  </div>
)
function App() {
  return (
    <div className="App">
    <Link to='/hats' >Topics</Link>
      <Switch>
        <Route exact path='/' component={Homepage}/>
        <Route   path='/hats/:hatid' component={Hatspage}/>
      </Switch>

    </div>
  );
}

export default App;
